import React from 'react'
import { Container, Card, CardContent, Typography, Box } from '@mui/material';

const ItemTypes = () => {
  return (
    <Container maxWidth= "lg" sx={{ bgcolor: '#e3e3e3', borderRadius: '8px', height: '97vh',marginBottom: '10px',marginTop: '10px'}}>
        <Box maxWidth="lg" sx={{ backgroundColor: '#10f5ff', height: 'auto' }}>
            <Typography variant="h4" gutterBottom>
                Welcome to My Material UI Page
        </Typography>

        </Box>
    </Container>
  )
}

export default ItemTypes
